  const url = `http://openapi.${item.en_name}.go.kr:8088/644f5065566962793636474968446e/json/${item.shortcut}ModelRestaurantDesignate/1/100/`;

  const [info, setInfo] = useState({
    name: '',
    addr: '',
    main_menu: ''
  });

  useEffect(() => {
    axios.get(url).then(result => console.log(result));
  });
  return <div>This is RestaurantResult</div>;
};

export default RestaurantResult;
